import "./styles.css";

export default function Card({
  nome,
  logo,
  estado,
  custo,
  valorMinimo,
  clientes,
  avaliacao,
}) {
  return (
    <div className="card-fornecedores">
      <div className="flex-row">
        <div
          className="logo-fornecedores"
          style={{
            backgroundImage: `url(${logo})`,
            backgroundPosition: "center center",
            backgroundSize: "cover",
          }}
        ></div>
        <h2>{nome}</h2>
      </div>
      <div className="flex-row infos-fornecedores">
        <spam>UF: {estado}</spam>
        <spam>Custo por KWH: {custo}</spam>
        <spam>Número de clientes: {clientes}</spam>
        <spam>Avaliação média: {avaliacao}</spam>
      </div>
    </div>
  );
}
